function Schedule_Item({event, time }) {
    return(
        <li class="list-timeline-item p-0 pb-3 pb-lg-4 d-flex flex-wrap flex-column">
            <p class="my-0 text-dark flex-fw text-sm text-uppercase"><span class="text-inverse op-8">{time}</span> - {event_name}</p>
        </li>

    );
}

export default Schedule_Item;
